import React, { Fragment } from 'react';
import { useNavigate } from "react-router-dom";
import { Button } from 'react-bootstrap';
//import { render } from 'https://cdn.skypack.dev/react-dom'
//const ROOT_NODE = document.querySelector('#app')

function HomePage() {
    const navigate = useNavigate();
    const handleClick = e => {
        // e.preventDefault()
        navigate("/" + e);
    }


    // <head>
    //     <meta charset="utf-8" />
    //     <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    //     <title>Untitled</title>
    //     <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/4.1.3/css/bootstrap.min.css" ></link>
    //     <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css" ></link>
    //     <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Bitter:400,700" ></link>
    //     <link rel="stylesheet" href="assets/css/style.css" ></link>
    // </head>
    return (

                                    <Fragment>

                                                <Button onClick={() => handleClick('SignIn')}>
                                                    sign In
                                                </Button>
                                            
<Button onClick={() => handleClick('SignUp')}>
                                                sign Up
                                            </Button>
<Button onClick={() => handleClick('About')}>
                                                About
                                            </Button>
<Button onClick={() => handleClick('About')}>
                                                About
                                            </Button>
<Button onClick={() => handleClick('OrderDrive')}>
                                                Order Drive
                                            </Button>
<Button onClick={() => handleClick('LogOut')}>
                                                Log Out
                                            </Button>

                                    </Fragment>
    );
};

//render(<HomePage />, ROOT_NODE)
export default HomePage;
